import { Component } from "react"
import Cuerpo from "./cuerpo/cuerpo"
import Encabezado from "./encabezado"
import axios from "../conexion"


class Principal extends Component{

    componentDidMount(){
        const ingreso= this.Ingreso();
        console.log(ingreso)
    }
    
    async Ingreso(){
        var config = {
            method: 'get',
            url: 'http://localhost:3200/api/operation/Ingreso/'+ this.props.id,
            headers: { 
              'Content-Type': 'application/x-www-form-urlencoded'
            },
        }
        var datos= await axios(config)
        return (datos.datos[0]["monto"])
    }

    render(){
        return(
            
            <div>
                <Encabezado id= {this.props.id} />
                <Cuerpo id= {this.props.id}/>
            </div>
        )
    }
}

export default Principal;
